(18, 'Herizo', 'Josoa', 'pdg@creativdev-mada.com', '2016-10-04 08:35:00', 'Cette personne <strong>pdg@creativdev-mada.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Herizo<br />Prénom: Josoa<br />Email: pdg@creativdev-mada.com<br />message: <br />Bonjour,\n\nJe suis H. JOSUE, PDG de CREATIVEDEV qui est basé à Antananarivo Madagascar.\n\nDepuis 2008, nous offrons, à des sociétés comme vous, notre service de sous-traitance de projets informatiques à un tarif offshore.\n\nNous proposons :\n\n-       Création de site internet : vitrine, e-commerce, responsive design, cms wordpress;\n\n-       Rédaction d’article web : fiche produit, blog,  article informatif ;\n\n-       Retouche photo, détourage, traitement, montage\n\n-       Intégration de newsletter responsive;\n\n-       Création graphique : logo, bannière, support d’impression\n\n-       Développement web avec php/mysq et jquery;\n\n-       Conception de logiciel avec l’AGL Windev;\n\n-       Télésecrétariat à partir de 400EUR/mois : frappe de document, réception téléphonique, modération de site, chat\n\n-       etc.\n\nAvez-vous bien une surcharge de travail? Vous désirez augmenter vos bénéfices? Vous désirez élargir votre activité? Vous voulez réduire vos impôts?\n\nJe vous propose que nous en discutions.\n\nJe vous invite à me répondre en détaillant vos besoins actuels. En attendant, vous pouvez visiter notre site web http://www.creativdev-mada.com pour en savoir davantage sur nos services.\n\nCordialement,\n\n\n\nH. JOSUE – PDG CREATIVEDEV\n\nSkype : creativedev_mada\n\nTél: 00261344344433\n\n<br />'),
(19, 'Tran', 'Richard', 'Izida51100@gmail.com', '2016-11-14 14:47:54', 'Cette personne <strong>Izida51100@gmail.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Tran<br />Prénom: Richard<br />Email: Izida51100@gmail.com<br />message: <br />Bonjour Madame, Monsieur,\n\nActuellement en 2ème année de BTS Services Informatique Aux Organisations, je suis à la recherche d’un stage en développement informatique du 09 Janvier 2017 au 10 Février 2017, je souhaite par la présente vous proposer ma candidature.\nJe vous prie donc de bien vouloir me contacter afin quej e vous joint, mon curriculum vitae qui vous donnera de plus amples renseignements sur mon profil et mes expériences professionnelles.\nCordialement.<br />'),
(20, 'Dardek', 'Nahim', 'ndardek@gmail.com', '2016-11-24 23:07:32', 'Cette personne <strong>ndardek@gmail.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Dardek<br />Prénom: Nahim<br />Email: ndardek@gmail.com<br />message: <br />Bonjour je suis étudiant et Jai un projet informatique à réaliser je suis complètement bloqué et l\'échéance approche si une soirée on pouvais se rencontrer pour vous montrer mon projet et que vous m\'aidiez à résoudre les problèmes comme ça japprendrai aussi :) \nMerci \nUn etudiant qui à besoin de vous!<br />'),
(21, 'NIGRO', 'Florian', 'florian.nigro@etudiant.univ-reims.fr', '2016-12-14 09:04:00', 'Cette personne <strong>florian.nigro@etudiant.univ-reims.fr</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: NIGRO<br />Prénom: Florian<br />Email: florian.nigro@etudiant.univ-reims.fr<br />message: <br />Bonjour Monsieur,\n\nDans le cadre de notre projet de communication en DUT Informatique, notre groupe de projet est amené à interviewer une personne exerçant un métier de l\'informatique. Etant donné que nous avons choisi le métier de développeur web,  nous aimerions que vous répondiez à quelques questions par écrit dans le but d\'intégrer cette interview à un site WEB concernant ce métier.\n\nCordialement,\n\nNigro Florian<br />'),
