(39, 'ALAMI', 'Amine', 'commercial@planetsoft.ma', '2017-03-27 17:30:37', 'Cette personne <strong>commercial@planetsoft.ma</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: ALAMI<br />Prénom: Amine<br />Email: commercial@planetsoft.ma<br />message: <br />Bonjour, \nPLANET SOFT (www.planetsoft.ma) est votre partenaire idéal au Maroc pour la sous traitance Web. \nNos prestations sont destinées aux agences web, Web Marketeurs,..\nNos tarifs journaliers sont très compétitifs pour vous permettre de réduire vos coûts de plus de 50%. \nNotre domaine d\'expertise est le Développement Web: Wordpress, HTML5-CSS3, Javascript, PHP, Symfony, J2EE, WinDev, Design graphique, Référencement naturel (SEO),...\nDepuis 2011, nous travaillons en Sous-Traitance avec des Partenaires Européen sur des projets Web pour des clients variés: Administration,Industrie, Commerce, Hôtels, Restaurants,...\nNous souhaitons bâtir un partenariat avec vous pour la réalisation de vos projets et ceux de vos clients. \nCordialement. \nAmine ALAMI -P.D.G- +212 6 61 35 20 92. \nE-mail : commercial@planetsoft.ma.\nSite web : www.planetsoft.ma. \nAdresse : N°:17, 3éme étage, Bureaux Noor, Lotissement Walili, Avenue des FAR, Fès, Maroc.<br />'),
