(59, 'LOMBARD ', 'GAELLE', 'contact@cvs-france.net', '2017-11-21 14:27:56', 'Cette personne <strong>contact@cvs-france.net</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: LOMBARD <br />Prénom: GAELLE<br />Email: contact@cvs-france.net<br />message: <br />Bonjour,\n\nJe suis Gaëlle LOMBARD de CVS France, nous sommes spécialisés dans l’accompagnement et la formation \ndes dirigeants d’entreprise, startup, indépendants. \n\nVous êtes souvent sollicités, nous aussi. Je vous rassure nous ne sommes pas là pour vous vendre quelque chose.\nNous sommes à la recherche d\'un partenaire dans votre domaine d’activité.\nNous recherchons quelqu\'un de relativement disponible (pas surbooké) et de réactif qui souhaite développer son activité.\n\nSi vous êtes dans ce cas de figure, vous pouvez prendre contact avec nous afin d\'évoquer le sujet.\n\nDans l\'attente de votre retour,\n\nBien cordialement,\nG LOMBARD<br />'),
(60, 'ALOHA CREATION', 'Martine Molitor', 'molitor@alohacreation.fr', '2018-01-08 10:00:50', 'Cette personne <strong>molitor@alohacreation.fr</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: ALOHA CREATION<br />Prénom: Martine Molitor<br />Email: molitor@alohacreation.fr<br />message: <br />Bonjour, je vous contacte car nous avons besoin de sous-traiter la prestation de développement web et d\'envisager une collaboration avec une personne ayant votre profil.\nPourrions-nous nous rencontrer car nous avons actuellement une demande à laquelle nous devons répondre rapidement !\nVous pouvez me contacter au 02 26 47 03 60 \nMartine Molitor / directrice<br />'),
