(63, 'MOLITOR', 'Martine', 'molitor@alohacreation.fr', '2018-11-19 10:20:18', 'Cette personne <strong>molitor@alohacreation.fr</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: MOLITOR<br />Prénom: Martine<br />Email: molitor@alohacreation.fr<br />message: <br />Bonjour,\nJe dirige l\'agence Aloha Création, et je dois répondre à un travail graphique : carte de vœux pour une structure régionale et  proposer une version animée de cette carte : vidéo/page web éphémère/web app/ mini-site/recours à la réalité augmentée/animations à scroller en ligne...au choix - Je cherche un fournisseur capable de faire ce travail animé à partir de recommandations graphiques de l\'Agence. Dans un premier temps, nous pourrions nous rencontrer ou en discuter au tél. afin de bien détailler la demande et que vous me fassiez une offre de prix. C\'est très urgent car je dois remettre la préconisation le 22 novembre à midi.\nVous pouvez me joindre au 03 26 47 03 60 ou au 06 07 67 66 64. \nmerci !<br />'),
(64, 'Ker', 'Anil', 'anil.k@manektechmail.com', '2018-11-21 05:58:20', 'Cette personne <strong>anil.k@manektechmail.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Ker<br />Prénom: Anil<br />Email: anil.k@manektechmail.com<br />message: <br />Attention to CEO,\n\nHope you are doing well,\n \nJust a short introduction, My name is Anil Ker working with ManekTech an IT company which has expertise in designing and developing Websites, Software & Mobile apps.\n \nPlease feel free to visit our website :- http://www.manektech.com\n \nOur Portfolio :- http://www.manektech.com/portfolio.html  \n \nWe charge $15/hr\n \nKindly let us know your convenient timing for the discussion of your project via phone call or chat via Skype or Hangout whatever you prefer best.\n \nLooking forward to hear your reply.\n\nRegards,\nAnil Ker.<br />'),
(65, 'Emma', 'Emma', 'emma.joee85@gmail.com', '2019-01-04 08:12:03', 'Cette personne <strong>emma.joee85@gmail.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Emma<br />Prénom: Emma<br />Email: emma.joee85@gmail.com<br />message: <br />Hi, \n\nI want to check the option to collaborate with your site: www.marmits.com\n\nI would like to publish an article at your site with 1-2 text links to my client (casino reviews site). \nIf needed we can provide high quality content that will have as well inner link and authority link and will fit to your site topics. \n\nHow much do charge for such a collaboration? \n\nLooking forward to your response,\n\nEmma<br />'),
(66, 'Patel', 'Ritesh', 'sales@incipientinfo.com', '2019-06-11 12:32:53', 'Cette personne <strong>sales@incipientinfo.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Patel<br />Prénom: Ritesh<br />Email: sales@incipientinfo.com<br />message: <br />\nHello,\nGreetings of the day..!!\nWe are an emerging IT company, offers a wide range of IT services with a team of young & dedicated professionals having 5+years of experience in website and mobile app development..\n\nWe are specialize in creating awesome results driven work in UI/UX designing, HTML/HTML5,CSS/CSS3,Bootstrap,Angular JS, Java script, Ajax, J query, PSD to HTML, PSD to Word Press,PHP, Word Press,e-commerce,Android(Java & Kotlin) and iOS(Objective C & Swift).\n\nWe are available more than 40+ hours per week and providing the best quality work within your budget.\n\nYou can review my profile from following link.\n\nLinkedin :-https://www.linkedin.com/in/ritesh-patel-079207103/\n\nPlease feel free to get in touch.\nSkype Id: incipientinfo\nContact No:-+91-9586083980\n\nLooking forward to build a long-term business relationship with you.\n\nBest Regards,\nRitesh\n<br />'),
(67, 'Lefevre', 'Anthony', 'lefevre.anthony.dev@gmail.com', '2019-08-01 19:56:10', 'Cette personne <strong>lefevre.anthony.dev@gmail.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Lefevre<br />Prénom: Anthony<br />Email: lefevre.anthony.dev@gmail.com<br />message: <br />Bonjour je vous contact car je suis en formation développeur web a la wild code school de Reims et je suis en recherche de stage pour octobre pour une période de 4 mois est ce que vous prenez des stagiaires ? Merci.<br />'),
(68, 'Trouchkine', 'Martial', 'marty.tkn@gmail.com', '2019-11-05 09:58:05', 'Cette personne <strong>marty.tkn@gmail.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Trouchkine<br />Prénom: Martial<br />Email: marty.tkn@gmail.com<br />message: <br />Bonjour,\nActuellement militaire en reconversion professionnelle, \nje suis à la recherche d\'une période pratique en entreprise dans le domaine du développement WEB et WEB mobile sur la période du 11/05 au 31/07/20. Sur Reims et ses alentours.\nJe reste à votre entière disposition pour touts renseignements complémentaires si vous souhaitez donner suite à ma demande par mail, ou par téléphone au 06.65.90.35.03.\nCordialement,\nMr Trouchkine Martial<br />'),
(69, 'Debray ', 'Jordan', 'contact@essencevisuelle.fr', '2020-06-08 11:27:47', 'Cette personne <strong>contact@essencevisuelle.fr</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Debray <br />Prénom: Jordan<br />Email: contact@essencevisuelle.fr<br />message: <br />Bonjour,\n\nJe me présente à vous pour une éventuelle collaboration. \nDesigner graphique depuis 10 ans, j\'interviens dans plusieurs disciplines de la création visuelle en tant que directeur artistique, graphiste, motion designer et webdesigner.\n\nCollaborer ensemble\n> Vous n\'avez plus le temps pour tous vos projets et vous souhaitez externaliser :\nRegagner en réactivité en faisant appel à un prestataire qui va gérer la création graphique pour votre client.\n\n> Vous êtes consulté pour un projet d\'ampleur qui nécessite\ndes compétences particulières :\nConfiez-moi le projet de communication qui nécessite une étude graphique poussée et la construction d’une image de marque qui sera ensuite développer sur différents supports. En effet l’idée étant d’être en amont de votre mission de déploiement et de fabrication.\n>\n> Vous avez certainement des prestations qui peuvent moi aussi m\'intéresser :\nJe cherche régulièrement des prestataires pour l’impression, la fabrication de supports imprimés, ou encore du développement web provenant de mes clients (Si vous avez un catalogue n’hésitez pas à me le faire parvenir).\n\nJe reste à disposition pour échanger.\nBonne journée\nJordan\nwww.essencevisuelle.fr<br />'),
