(133, 'BONETTI', 'Raphael', 'reims@pacinformatique.com', '2021-06-21 17:30:07', 'Cette personne <strong>reims@pacinformatique.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: BONETTI<br />Prénom: Raphael<br />Email: reims@pacinformatique.com<br />message: <br />nous sommes à la recherche d\'un developpeur Windev. Seriez vous interessé ? <br />'),
(134, 'Belloy', 'Rudy', 'levieuxreude@gmail.com', '2022-09-29 14:12:55', 'Cette personne <strong>levieuxreude@gmail.com</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Belloy<br />Prénom: Rudy<br />Email: levieuxreude@gmail.com<br />message: <br />Bonjour,\nJe suis entrain de monter un dossier Transition-pro pour faire une formation développeur web, pour ce dossier je dois fournir quelques « enquêtes métier », ils s’agit d’une dizaine de questions concernant la profession. Je voulais donc vous demander si vous seriez d’accord pour répondre à ces questions (lors d’un rdv téléphonique par exemple) ?\nMerci de votre attention, bonne journée <br />'),
(135, 'Elodie', 'Henry', 'com2@e-digital.fr', '2023-04-07 11:46:38', 'Cette personne <strong>com2@e-digital.fr</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Elodie<br />Prénom: Henry<br />Email: com2@e-digital.fr<br />message: <br />Bonjour Madame, Monsieur,\n\nAvez-vous déjà envisagé de travailler en sous-traitance avec une équipe de développeurs réactive et créative pour tous vos projets de développement internet sur mesure ou les projets qui ne vous intéressent pas ?\n\nE-digital.fr est une agence web digitale avec plus de dix ans d’expérience située à Paris Montparnasse avec une équipe de développement offshore. Notre expérience et expertise nous permettent de conduire de bout en bout n’importe quel projet de développement spécifique ou web. Nos partenaires sont des sociétés de services informatiques et d’autres agences de communications et publicités. Et nous serions très ravi de travailler en partenariat avec votre société.\n\nVoici quelques avantages à travailler avec nous :\n\nNotre taux horaire est de 30 € HT\nTravaillons en marque blanche\nAucun acompte au démarrage\nNous livrons les sources à la fin de chaque projet.\n\nAlors, si vous êtes à la recherche de compétences avec qui collaborer pour répondre aux besoins de vos clients ou les vôtres, vous pouvez nous joindre au 0184251681\n\nCordialement,\n.\nElodie.Henry\n\n|Tel: 01 84 25 16 81 |\n\n23 rue du Départ - 75 014 Paris\n\ncom2@e-digital.fr\n\nwww.e-digital.fr<br />'),
(136, 'Ashley Gallegos', 'Dustin Rosales', 'notification@ewebdns.co', '2024-02-01 13:49:50', 'Cette personne <strong>notification@ewebdns.co</strong> vient de vous envoyer un message via le formulaire de contact du site.<br />Nom: Ashley Gallegos<br />Prénom: Dustin Rosales<br />Email: notification@ewebdns.co<br />message: <br />Disclaimer: We are not responsible for any financial losses, information loss, reduction in SEO rankings, lost patrons, undeliverable email or any other detriments that you may experience upon the expiry of colortone-av.com. For more details please look at section 13.c.1a of our Terms and Conditions.\nHere is your last warning to renew colortone-av.com:\nhttps://ewebdns.co/renew/Q09MT1JUT05FLUFWLkNPTQ\nIn the case that colortone-av.com expires, we reserve the authority to offer your position to competing businesses in the identical sector and zone after 3 business days on an sale basis.\nThis constitutes the last communication that we are legally required to send out concerning the termination of colortone-av.com\nSecure Online Payment:\nhttps://ewebdns.co/renew/Q09MT1JUT05FLUFWLkNPTQ\nAll functions will be automatically reinstated on colortone-av.com if payment is obtained in full prior to expiry. We appreciate  your immediate attention to this.<br />');
