INSERT INTO `person` (`id`, `name`, `givenName`, `familyName`, `email`, `image`, `telephone`, `jobTitle`, `gender`, `honorificPrefix`, `birthDate`, `url`, `sameAs`, `description`, `nationality`) VALUES
(1, 'Geoffroy Stolaric', 'Geoffroy', 'Stolaric', 'geoffroy.stolaric@gmail.com', 'www/image/geoffroy.png', '+33 (0)6 23 46 54 47', 'Développeur Web;Développeur Digital;Développeur', 'Male', 'Mr', '1977-05-02', 'https://developpeur.marmits.com', 'https://plus.google.com/+GeoffroyStolaric', 'Professionnel du monde informatique<em> depuis 1998.</em>\r\n<br />Passionné depuis <a href=\"https://fr.wikipedia.org/wiki/Amstrad_CPC_6128\" target=\"new\">l\'Amstrad CPC 6128</a> jusqu\'au <a href=\"https://fr.wikipedia.org/wiki/Raspberry_Pi\" target=\"new\">Raspberry Pi</a>\r\n<br />Un parcours dans le domaine de la <strong>publicité</strong>, des <a href=\"https://fr.wikipedia.org/wiki/Entreprise_de_services_du_num%C3%A9rique\" target=\"new\">SSII</a>, du <strong>E-commerce</strong>, de l\'édition logiciel, et le <strong>développement informatique</strong> en général.\r\n<br />Bien que je sois ouvert et confronté à beaucoup de solutions (dernièrement des projets sur <strong>Windev</strong> et <strong>WebDev</strong>), c\'est essentiellement dans l\'univers <a href=\"https://fr.wikipedia.org/wiki/Open_source\" target=\"new\">Open source</a> que j\'exerce mon activité et mes recherches.\r\n<br />En tâche de fond, j\'essaie de me perfectionner sur les outils modernes autour de l\'architecture <a href=\"https://fr.wikipedia.org/wiki/Representational_state_transfer\" target=\"new\">RESTful</a> (Back-end et Front-end).', 'France');
